    false,nt"url": null,nt"notes": "This data set contains vector polygons
    representing the boundaries of all hardcopy cartographic products produced as part
    of the Environmental Sensitivity Index (ESI) for Guam and the Northern Mariana Islands.
    This data set comprises a portion of the ESI data for Guam and the Northern Mariana
    Islands. ESI data characterize the marine and coastal environments and wildlife
    by their sensitivity to spilled oil. The ESI data include information for three
    main components: shoreline habitats, sensitive biological resources, and human-use
    resources.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
